function createCookie(name, value, expTime, expMonth, expDay, path, domain, secure){
  var name='Source';
  var value='CJ';
  var url = window.location.href;
  var now = new Date();
  var time = now.getTime();
  var expTime = time + 1000*31536000;
  now.setTime(expTime);
  var cookieString = name + "=" + value;
  var domain= 'wes.com';
 
  if(expTime){
    cookieString += "; expires=" + now.toGMTString();
                }
  if(path){
    cookieString += "; path=" + path
                }
  if(domain){
    cookieString += "; domain=" + domain
                }
  if(secure){
                cookieString += "; secure"
                }
  if(url.indexOf('?ref='+ 'cj')!== -1){
    document.cookie = cookieString;
                }
 
  }
 
createCookie();
 
function readCookie(name){
  var results = document.cookie.match(name + '=(.*?)(;|$)')
  if(results){
    return 'TRUE'
    }
  else{
    return 'FALSE'
    }
  }

 

