var body = document.getElementsByTagName('body')[0]; //set body to a variable so you can use .style method
var img_index = Math.floor(Math.random() * (img_array.length - 0 + 1)); //start the image index at a random number between 0 and the length of the array

function changeBG(){
  body.style.backgroundImage = 'url(' + img_array[img_index] + ')';
  img_index = Math.floor(Math.random() * (img_array.length - 0 + 1)); //randomize img_index again for the next image
}
changeBG(); //run the function initially to set the first background to random image
setInterval(changeBG, 120000); //run function again every x milliseconds, if
